import React from "react";
import IndividualInvoice from "./IndividualInvoice";

const InvoiceList = (props) => {
    return (
        <div>
          {props.values.map((value) => (
            <IndividualInvoice 
                key={value.key}
                name={value.name}
                dueDate={value.dueDate}
                billNo={value.billNo}
                billDate={value.bill}
            />
          ))}

        </div>
    )
};

export default InvoiceList;
